INSERT INTO `libros` (`id`, `portada`, `titulo`, `autor`, `descripcion`, `cantidad`, `estado`) VALUES
(1, , 'Clean Code', 'Robert C. Martin', 'Incluso el código incorrecto puede funcionar. Pero si el código no es limpio, puede poner de rodillas a una organización de desarrollo. Cada año, se pierden innumerables horas y recursos importantes debido a un código mal escrito. Pero no tiene por qué ser así. El destacado experto en software Robert C. Martin presenta un paradigma revolucionario con Clean Code: A Handbook of Agile Software Craftsmanship. Martin se ha asociado con sus colegas de Object Mentor para resumir sus mejores prácticas á', 66, 'Activo');
INSERT INTO `libros` (`id`, `portada`, `titulo`, `autor`, `descripcion`, `cantidad`, `estado`) VALUES
(2, , 'Aura', 'Carlos Fuentes', 'En esta novela corta, Fuentes explora temas de amor, pasión y misterio. Ambientada en la Ciudad de México, la historia sigue a Felipe Montero, un joven historiador que es contratado para organizar los escritos de la enigmática señora Consuelo. Con una narrativa envolvente y atmosférica,', 60, 'Activo');
INSERT INTO `libros` (`id`, `portada`, `titulo`, `autor`, `descripcion`, `cantidad`, `estado`) VALUES
(3, , '1984', 'George Orwell', 'En esta distopía clásica, Orwell nos transporta a un futuro sombrío donde el Gran Hermano lo vigila todo. El protagonista, Winston Smith, lucha por mantener su individualidad en un mundo totalitario donde la libertad de pensamiento es suprimida.', 40, 'Activo');
INSERT INTO `libros` (`id`, `portada`, `titulo`, `autor`, `descripcion`, `cantidad`, `estado`) VALUES
(4, , 'Cien años de soledad', 'Gabriel García Márquez', 'Esta obra maestra del realismo mágico narra la historia de la familia Buendía a lo largo de siete generaciones en el ficticio pueblo de Macondo. Márquez teje una narrativa envolvente llena de personajes memorables y eventos fantásticos.', 65, 'Activo');
INSERT INTO `libros` (`id`, `portada`, `titulo`, `autor`, `descripcion`, `cantidad`, `estado`) VALUES
(5, , 'Rayuela', 'Julio Cortázar', 'Cortázar nos presenta una novela experimental y desafiante. El lector tiene la opción de seguir el orden lineal de la historia o aventurarse por un camino no convencional, saltando entre capítulos y creando su propio recorrido de lectura.', 40, 'Activo');
